	@Override
	public synchronized void animatePlate(Plate aPlate, int avatar) {
		int sleep = 500;
		Thread a = new Thread();
		a.start();
		for (int i=0; i<39; i++) {
			//aPlate.setHeight(i);
			//aPlate.setWidth(i);
			chefList.get(avatar).chef.getPlate().setHeight(i);
			chefList.get(avatar).chef.getPlate().setWidth(i);
			ThreadSupport.sleep(sleep);
//			try {
//				Thread.sleep(sleep);
//			} catch (InterruptedException e) {
//				e.printStackTrace();
//			}
		}
		Thread.yield();
	}
	
	
